INSERT INTO `v1_40d97d555cd6dd974352ffb2da2a5a030c621f4853d106995a46b8c56e58020f` VALUES (1, 0.5, 11, 0, "むっ、ちょっと待て。\nこの絵のテーマは、繰り返される\n運命の闘争が織りなす限りなき\nウロボロスの循環ではないのか！？", 0, 18812, 100911, 18812031, 10, 1);
