INSERT INTO `v1_40d97d555cd6dd974352ffb2da2a5a030c621f4853d106995a46b8c56e58020f` VALUES (1, 0.5, 11, 0, "クスクス……違います。\nこれはあのおかたへの愛……\n枯れることのない、永遠の愛が\nテーマですわ……", 0, 18812, 102711, 18812036, 10, 1);
