INSERT INTO `v1_40d97d555cd6dd974352ffb2da2a5a030c621f4853d106995a46b8c56e58020f` VALUES (1, 0.5, 11, 0, "いや、浮世絵って\nこんな感じだったか？\nオーエドで見たのは、もう少し\n違う雰囲気だった気がするのだが。", 0, 19812, 105311, 19812034, 10, 1);
