INSERT INTO `v1_40d97d555cd6dd974352ffb2da2a5a030c621f4853d106995a46b8c56e58020f` VALUES (1, 0.5, 11, 0, "美を伝えるという点では同じだよ。\nボクだって歯磨きをするボクや\nお昼ご飯を食べるボクがいるけど、\n全て美しいボクには違いないでしょ？", 0, 19812, 100811, 19812039, 10, 1);
